import React from 'react';
import './Routine.css';

const RoutinePage = () => {
  return (
    <div className="routine-container">
      <h1>Rutina 1</h1>
      <div className="day">
        <h2>Dia X <button>+ (agregar día antes o después)</button></h2>
        <div className="exercise">
          <p>Ejercicio</p>
          <button>+ (agregar ejercicio antes o después)</button>
        </div>
        <div className="exercise">
          <p>Ejercicio</p>
          <button>+ (agregar ejercicio antes o después)</button>
        </div>
        {/* Puedes añadir más ejercicios aquí */}
      </div>
      {/* Puedes añadir más días aquí */}
      <button className="add-day">+ (para crear día nuevo)</button>
    </div>
  );
};

export default RoutinePage;
